import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import './Navbar.css';

const Navbar = () => {
    const [click, setClick] = useState(false);

    const handleClick = () => setClick(!click);

    return (
        <nav className="navbar">
            <div className="navbar-container">
                <div className="logo">
                    <Link to="/" className="navbar-logo">Tournoi</Link>
                </div>
                <div className="menu-icon" onClick={handleClick}>
                    <i className={click ? 'fas fa-times' : 'fas fa-bars'} />
                </div>
                <ul className={click ? 'nav-menu active' : 'nav-menu'}>
                    <li className="nav-item">
                        <Link to="/sactions" className="nav-links" onClick={handleClick}>Sactions</Link>
                    </li>
                    <li className="nav-item">
                        <Link to="/joueurs-inscrit" className="nav-links" onClick={handleClick}>Joueurs Inscrit</Link>
                    </li>
                    <li className="nav-item">
                        <Link to="/classement" className="nav-links" onClick={handleClick}>Classement</Link>
                    </li>
                    <li className="nav-item">
                        <Link to="/contact" className="nav-links" onClick={handleClick}>Contact</Link>
                    </li>
                </ul>
            </div>
        </nav>
    );
};

export default Navbar;
